import React from 'react';
import Card from './card';
const App = () => {
  return (
    <div>
      <Card
        title="Sample Card 1"
        description="This is a sample card with a descr."
        image="https://in.pinterest.com/pin/211174976781037/"
      />
      <Card
        title=""
        description="Shop online fashion and enjoy exclusive discounts Tops at stylewe Online Stores.stylewe offers fashion black and white women's Tops with pops of color and patterns for Sale."
        image="https://in.pinterest.com/pin/805511083368582278/"
      />
    </div>
  );
};

export default App;
